import React from "react";
import "./apaksa.css";

export const apaksa = ({ styleProps = {}, children }) => {
  const STYLE = {
    display: "flex",
    flexDirection: "column",
    alignItems: "flex-start",
    justifyContent: "center",
  };

  return (
    <div
      // first default then overrides
      className="apaksa"
    >
      <div style={{ ...STYLE, ...styleProps }}>
        {children}
      </div>
    </div>
  );
};
